{
  "word": "pan",
  "pronunciation": "/pæn/",
  "definitions": [
    {
      "partOfSpeech": "名詞",
      "meaning": "調理器具。平らで浅い調理用の鍋や容器",
      "examples": ["She cooked eggs in a frying pan.", "Put the cake pan in the oven."]
    },
    {
      "partOfSpeech": "動詞",
      "meaning": "カメラやビデオで横に動かしながら撮影する",
      "examples": ["The camera panned across the landscape.", "He panned the camera to capture the entire scene."]
    },
    {
      "partOfSpeech": "動詞",
      "meaning": 批判する、否定的に評価する",
      "examples": ["Critics panned the new movie.", "The book was panned by reviewers."]
    },
    {
      "partOfSpeech": "名詞",
      "meaning": "金鉱を探すための平たい容器",
      "examples": ["Prospectors used pans to search for gold.", "He sifted the river sand with a pan."]
    }
  ],
  "synonyms": ["skillet", "criticize", "condemn"],
  "antonyms": ["praise", "commend"]
}

